import React from 'react';

import classes from './Header.module.css';
import headerImage from '../../../assets/header1.jpeg';

const Header = () => {
    return (
        <>
            <header className={classes['header']}>
                <h1>ブライアン寿司</h1>
                <button>Click</button>
            </header>

                <img
                    className={classes['main-image']}
                    src={headerImage}
                    alt="Header"
                />

        </>
    );
};

export default Header;
